import React from "react";
import "./style.scss";

function TreeItem() {
	return (
		<ul className="tree">
			<li className="section">
				<input type="checkbox" id="groupB" />
				<label htmlFor="groupB">Group B</label>
				<ul>
					<li>Group B Item 1</li>
					<li>Group B Item 2</li>
					{/* <!-- SUB-SECTION --> */}
					<li className="section">
						<input type="checkbox" id="groupC" />
						<label htmlFor="groupC">Group C</label>
						<ul>
							<li>Group C Item 1</li>
							<li>Group C Item 2</li>
						</ul>
					</li>
				</ul>
			</li>
		</ul>
	);
}

export default TreeItem;
